import './App.css';

function App() {
  return (
    <main>
      <div className="container">
        <div className="cover-container">
          <h1>Quizzical</h1>
          <p>Quiz about general knowlege!</p>
          <button>Start Quiz</button>
        </div>
      </div>
    </main>
  );
}

export default App;
